// SPDX-License-Identifier: GPL

pragma solidity 0.8.0;

import "./libs/zeppelin/token/BEP20/IBEP20.sol";

contract SendHolder {
  IBEP20 public usdtToken = IBEP20(0x55d398326f99059fF775485246999027B3197955);

  address public mainAdmin;

  constructor() {
    mainAdmin = msg.sender;
  }

  function _isMainAdmin() public view returns (bool) {
    return msg.sender == mainAdmin;
  }

  modifier onlyMainAdmin() {
    require(_isMainAdmin(), "onlyMainAdmin");
    _;
  }

  function send(address[] calldata _addresses, uint amount) onlyMainAdmin public {
    for (uint i = 0; i < _addresses.length; i++) {
      usdtToken.transfer(_addresses[i], amount);
    }
  }
}
